import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './TripDetails.css';

const TripDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [trip, setTrip] = useState(null);
  const [updatedTrip, setUpdatedTrip] = useState({
    name: '',
    pickupPoint: '',
    dropPoint: '',
    modeOfTransport: '',
    model: '',
    totalPeople: 0,
  });

  // Fetch trip details when the component is mounted (for updating an existing trip)
  useEffect(() => {
    if (id) {
      const fetchTripDetails = async () => {
        try {
          const response = await axios.get(`http://localhost:5000/api/trips/${id}`);
          setTrip(response.data);
          setUpdatedTrip({
            name: response.data.name,
            pickupPoint: response.data.pickupPoint,
            dropPoint: response.data.dropPoint,
            modeOfTransport: response.data.modeOfTransport,
            model: response.data.model,
            totalPeople: response.data.totalPeople,
          });
        } catch (error) {
          console.error('Error fetching trip details:', error);
          alert('Error fetching trip details');
        }
      };
      fetchTripDetails();
    }
  }, [id]);

  // Handle input field changes for updating trip details
  const handleChange = (e) => {
    const { name, value } = e.target;
    setUpdatedTrip((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  // Handle PUT request to update the trip details
  const handleUpdateTrip = async () => {
    try {
      const response = await axios.put(`http://localhost:5000/api/trips/${id}`, updatedTrip);
      alert('Trip updated successfully');
      navigate(`/trips/${id}`); // Redirect to the updated trip page
    } catch (error) {
      console.error('Error updating trip:', error);
      alert('Error updating trip');
    }
  };

  // Handle POST request to create a new trip (if no trip ID exists)
  const handleCreateNewTrip = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/trips', updatedTrip);
      alert('New trip created successfully');
      navigate(`/trips/${response.data.id}`); // Redirect to the newly created trip page
    } catch (error) {
      console.error('Error creating new trip:', error);
      alert('Error creating new trip');
    }
  };

  // Show a loading message if the trip data is still being fetched
  if (!trip && id) {
    return <div>Loading...</div>;
  }

  return (
    <div className="trip-details-page">
      <h1>{id ? 'Update Trip Details' : 'Create New Trip'}</h1>
      <div className="trip-info">
        <label>Name:</label>
        <input
          type="text"
          name="name"
          value={updatedTrip.name}
          onChange={handleChange}
          placeholder="Enter trip name"
        />

        <label>Pickup Point:</label>
        <input
          type="text"
          name="pickupPoint"
          value={updatedTrip.pickupPoint}
          onChange={handleChange}
          placeholder="Enter pickup point"
        />

        <label>Drop Point:</label>
        <input
          type="text"
          name="dropPoint"
          value={updatedTrip.dropPoint}
          onChange={handleChange}
          placeholder="Enter drop point"
        />

        <label>Mode of Transport:</label>
        <input
          type="text"
          name="modeOfTransport"
          value={updatedTrip.modeOfTransport}
          onChange={handleChange}
          placeholder="Enter mode of transport"
        />

        <label>Model:</label>
        <input
          type="text"
          name="model"
          value={updatedTrip.model}
          onChange={handleChange}
          placeholder="Enter model"
        />

        <label>Total People:</label>
        <input
          type="number"
          name="totalPeople"
          value={updatedTrip.totalPeople}
          onChange={handleChange}
          placeholder="Enter total number of people"
        />

        <button onClick={id ? handleUpdateTrip : handleCreateNewTrip}>
          {id ? 'Update Trip' : 'Create Trip'}
        </button>
      </div>
    </div>
  );
};

export default TripDetails;
